import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class App extends React.Component {
  handleSubmit() {
	this.props.history.push('/Home')
  }
  render() {
    return (
      <div>
        <h1>App.js</h1>
        <Link to="/Login">Login</Link>
      </div>
    )
  }
}

export default App;
